import React from 'react'

const Secondimg = () => {
  return (
    <div className='headimg'>
        <img src="https://unsplash.com/photos/green-grass-field-near-mountain-under-blue-sky-during-daytime-WvlFN57CyL8?utm_content=creditShareLink&utm_medium=referral&utm_source=unsplash" alt="Head Image" />
    </div>
  )
}

export default Secondimg;
